INSERT INTO `landings` VALUES (1,'complex','https://complex.one-team.pro/',3,'2023-08-27 23:53:04','2023-10-03 11:28:28','8 800 700 55 55','ЖК SKY BLUE','<p>Жилой комплекс класса бизнес на берегу моря в новом районе Алтынташ. Это первый район в Анталии с утвержденным проектом планировки территории</p>','uploads/landing_84724362.jpg','[{\"id\": \"0\", \"title\": \"2024\", \"content\": \"I квартал сдача жилого комплекса\"}, {\"id\": \"1\", \"title\": \"50\", \"content\": \"Всего квартир в комплексе\"}, {\"id\": \"2\", \"title\": \"ВНЖ\", \"content\": \"Вид на жительство при покупке\"}, {\"id\": \"3\", \"title\": \"2\", \"content\": \"Больших бассейна на территории ЖК\"}]',NULL,'PERGE COLLECTION: SKY BLUE','БИЗНЕС-КЛАСС НА БЕРЕГУ СРЕДИЗЕМНОГО МОРЯ','[{\"id\": \"0\", \"photo\": \"uploads/landing_1408793994.png\", \"title\": \"Большая закрытая территория с двумя бассейнами\", \"content\": \"<p>5700м2 - идеальная территория для 50 квартир, чтобы чувствовать уединенность и приватность. На территории есть сауна и тренажерный зал. Разноуровневые посадки растений по всей территории по индивидуальному проекту. Спортивная площадка для баскетбола, волейбола или тенниса.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_1793062718.png\", \"title\": \"Большая закрытая территория с двумя бассейнами\", \"content\": \"<p>5700м2 - идеальная территория для 50 квартир, чтобы чувствовать уединенность и приватность. На территории есть сауна и тренажерный зал. Разноуровневые посадки растений по всей территории по индивидуальному проекту. Спортивная площадка для баскетбола, волейбола или тенниса.</p>\"}]','[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\"}]','uploads/landing_406444150.png','ВНЖ','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Afc64a3d223ff913723c16022e4266225030f99a540ffe10915e3499fe62a343b&amp;source=constructor&amp;scroll=false\" width=\"100%\" height=\"500\" frameborder=\"0\"></iframe>',NULL,NULL,'PERGE COLLECTION','Анталья, Турция',16),(7,'country','https://country.one-team.pro/',2,'2023-10-20 10:30:25','2023-10-20 10:30:25','8 800 700 55 55','ТУРЦИЯ','<p>Регион, в котором море, солнце, история и природа соединяются в гармонии. Древние города, море, солнце, пляж, лес - компоненты одного прекрасного целого. Мустафа Кемаль Ататюрк описывает Анталью фразой: &laquo;Несомненно, Анталья - самое красивое место в мире&raquo;.</p>','uploads/landing_459739980.jpg','[{\"id\": \"0\", \"title\": \"310\", \"content\": \"Солнечных дней в году\"}, {\"id\": \"1\", \"title\": \"50\", \"content\": \"Комплексов в продаже\"}, {\"id\": \"2\", \"title\": \"ВНЖ\", \"content\": \"Вид на жительство при покупке\"}, {\"id\": \"3\", \"title\": \"15\", \"content\": \"Инвестиционный процент\"}]','НОВОСТРОЙКИ В ТУРЦИИ',NULL,NULL,NULL,'[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\"><li>Возможна удалённая сделка</li><li>Помощь по вариантам оплаты</li></ul>\"}]',NULL,'Вид на жительство в Турции','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Afc64a3d223ff913723c16022e4266225030f99a540ffe10915e3499fe62a343b&source=constructor&scroll=false\" width=\"100%\" height=\"500\" frameborder=\"0\"></iframe>','ДОСТОПРИЧАТЕЛЬНОСТИ ТУРЦИИ','[{\"id\": \"0\", \"photo\": \"uploads/landing_1531113488.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>Анталья &ndash; курортный город, который славится своей Старой гаванью, где швартуются яхты, и пляжами, окруженными огромными отелями.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_818982039.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>В Анталье расположены десятки исторических памятников культуры, которые непременно стоит увидеть! На протяжении всей своей истории Анталья становилась домом для десятка цивилизаций, сохранила следы этих цивилизаций и сегодня выставляет их для своих посетителей</p>\"}]',NULL,NULL,17),(8,'region','https://region.one-team.pro/',1,'2023-10-20 10:37:30','2023-10-20 10:37:30','8 800 700 55 55','АНТАЛИЯ','<p>Регион, в котором море, солнце, история и природа соединяются в гармонии. Древние города, море, солнце, пляж, лес - компоненты одного прекрасного целого. Мустафа Кемаль Ататюрк описывает Анталью фразой: &laquo;Несомненно, Анталья - самое красивое место в мире&raquo;.</p>','uploads/landing_2086620209.jpg','[{\"id\": \"0\", \"title\": \"310\", \"content\": \"Солнечных дней в году\"}, {\"id\": \"1\", \"title\": \"50\", \"content\": \"Комплексов в продаже\"}, {\"id\": \"2\", \"title\": \"ВНЖ\", \"content\": \"Вид на жительство при покупке\"}, {\"id\": \"3\", \"title\": \"15\", \"content\": \"Инвестиционный процент\"}]','НОВОСТРОЙКИ В АНТАЛИИ',NULL,NULL,NULL,'[{\"id\": \"0\", \"title\": \"Беспроцентная рассрочка\", \"content\": \"<p>Рассрочка на период строительства</p>\\r\\n<p>Первоначальный платеж 30% от стоимости квартиры</p>\\r\\n<ul class=\\\"list_point\\\">\\r\\n<li>Возможна удалённая сделка</li>\\r\\n<li>Помощь по вариантам оплаты</li>\\r\\n</ul>\\r\\n<p>Вид на жительство можете получить после внесения последнего платежа</p>\"}, {\"id\": \"1\", \"title\": \"Оплата 100%\", \"content\": \"<ul class=\\\"list_point\\\"><li>Возможна удалённая сделка</li><li>Помощь по вариантам оплаты</li></ul>\"}]',NULL,'Вид на жительство в Анталии','<p>Покупая квартиру в ЖК &laquo;Perge Collection: sky blue&raquo; вы не только приобретаете жилье в большом курортном городе с отличным климатом, которое можно сдавать в аренду, но и получаете более ценные преимущества, такие, как вид на жительство в Турции или даже гражданство.</p>\r\n<p>ВНЖ имеет ряд несомненных плюсов, вы можете круглогодично жить в стране, открыть свой бизнес, бесплатно пользоваться некоторыми государственными услугами, а также претендовать на турецкое гражданство уже через 5 лет после приобретения недвижимости.</p>\r\n<p>Турецкий паспорт позволит вам пользоваться всеми привилегиями этого государства, путешествовать в безвизовом режиме более чем по 110 странам, получить право открыть свое дело в США и Великобритании и многое другое.</p>\r\n<p>Процесс оформления проходит достаточно быстро и просто, а это значит, что, приобретая квартиру в нашем жилищном комплексе, вы инвестируете в свое будущее.</p>','<iframe src=\"https://yandex.ru/map-widget/v1/?um=constructor%3Afc64a3d223ff913723c16022e4266225030f99a540ffe10915e3499fe62a343b&source=constructor&scroll=false\" width=\"100%\" height=\"500\" frameborder=\"0\"></iframe>','ДОСТОПРИЧАТЕЛЬНОСТИ АНТАЛИИ','[{\"id\": \"0\", \"photo\": \"uploads/landing_274827534.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>Анталья &ndash; курортный город, который славится своей Старой гаванью, где швартуются яхты, и пляжами, окруженными огромными отелями.</p>\"}, {\"id\": \"1\", \"photo\": \"uploads/landing_350227984.png\", \"title\": \"Десятки исторических памятников культуры\", \"content\": \"<p>В Анталье расположены десятки исторических памятников культуры, которые непременно стоит увидеть! На протяжении всей своей истории Анталья становилась домом для десятка цивилизаций, сохранила следы этих цивилизаций и сегодня выставляет их для своих посетителей</p>\"}]',NULL,NULL,30);
