nd shopping center.','Alanya, Mahmutlar.\r\nKonut kompleksi, hareketli Mahmutlar bölgesinin kalbinde denize sadece 700 metre mesafede yer almaktadır.\r\nMağazalara, restoranlara, büyük Cumartesi pazarına ve alışveriş merkezine yürüme mesafesindedir.','2023-09-26 09:07:20','2023-10-12 20:52:37','Да','Нет','Да','Да','Да','Да','[{\"id\": \"0\", \"size\": \"60\", \"floor\": \"1\", \"price\": 196500, \"building\": \"Блок А\", \"price_code\": \"EUR\", \"apartment_layout\": \"1+1\", \"apartment_layout_image\": \"f13d9c4ed0f33398129d9f578dff49a8.jpg\"}, {\"id\": \"1\", \"size\": \"64.5\", \"floor\": \"5\", \"price\": 222996, \"building\": \"Блок B\", \"price_code\": \"EUR\", \"apartment_layout\": \"1+1\", \"apartment_layout_image\": \"9c0fa25c56e11e5b83727d6aa568814c.jpg\"}]',NULL,NULL,'Fitnessraum\r\nSauna und Hammam\r\nSpielzimmer für Kinder\r\nErholungsraum und Spielzimmer für Erwachsene\r\nTagungsräume\r\nFreibad 205 m²\r\nWinterschwimmbad 45 m²\r\nSpielplatz für Kinder\r\nKinderbecken\r\nStromerzeuger\r\nTiefgarage\r\nLadestation für Elektroautos auf allen Parkplätzen\r\nBarbecue-Bereich\r\nWeiß gestrichene Wände\r\nInnentüren aus Holz \r\nEingangstür aus Stahl \r\nKunststoff-Fenster\r\nKüchenmöbel\r\nBäder mit Sanitärkeramik und Duschmöbeln mit Spiegel\r\nAnschlüsse für Heizkörper \r\nLaminatfußboden in den Schlafzimmern, im Wohnbereich und im Flur, Fliesen in den Toiletten und in der Küche.\r\nMarmortreppe\r\nDeckenbeleuchtung und Beleuchtung von Haus und Hof','Alanya, Mahmutlar.\r\nDie Wohnanlage befindet sich nur 700 m vom Meer entfernt im Herzen des lebhaften Stadtteils Mahmutlar.\r\nIn fußläufiger Entfernung zu Geschäften, Restaurants, großem Samstagsmarkt und Einkaufszentrum.',NULL,0),(41,'17','30','sale','Ekpa-1207','Antalya/Kepez',300000,'270000',125000,'USD','1207 Antalya, названный в честь года освобождения Анталии, построен на участке площадью 30 гектаров с 1163 квартирами и 46 коммерческими магазинами, что делает его крупнейшим жилым проектом Антальи. В то время как зеленая территория площадью 24 712 м² предлагает жизнь, украшенную великолепными красотами природы, она дает возможность ощутить веселье города и покой природы одновременно с социальными удобствами внутри.','1207 Antalya, named after the year of Antalya\'s liberation, is built on a 30-hectare plot with 1,163 apartments and 46 commercial stores, making it Antalya\'s largest residential project. While the 24,712 m² green area offers a life adorned with the magnificent beauties of nature, it offers the opportunity to experience the fun of the city and the peace of nature at the same time as the social amenities inside.','Adını Antalya\'nın kurtuluş yılından alan 1207 Antalya, 30 hektarlık arsa üzerine inşa edilen 1.163 daire ve 46 ticari dükkân ile Antalya\'nın en büyük konut projesi olma özelliğini taşıyor. 24.712 m² yeşil alan, doğanın muhteşem güzellikleriyle bezenmiş bir yaşam sunarken, içerisindeki sosyal olanaklarla şehrin eğlencesini ve doğanın huzurunu aynı anda yaşama fırsatı sunuyor.',36.926280685739506,30.740471235882072,NULL,NULL,'Проект 1207 Antalya расположен в районе Кепез, в самом центре города, всего в 9 км от международного аэропорта Антальи, в 5 км от центра города и в 8 км от пляжа, с отличными социальными удобствами для всех, предлагая легкий доступ к повсюду.','Project 1207 Antalya is located in Kepez district, in the heart of the city, just 9 km from Antalya International Airport, 5 km from the city center and 8 km from the beach, with excellent social amenities for all, offering easy access to everywhere.','Proje 1207 Antalya, Kepez ilçesinde, şehrin kalbinde, Antalya Uluslararası Havalimanı\'na sadece 9 km, şehir merkezine 5 km ve plaja 8 km uzaklıkta, herkes için mükemmel sosyal olanaklara sahip, her yere kolay erişim imkanı sunmaktadır.','2023-09-26 09:38:08','2023-09-29 07:20:21','Да','Нет','Да','Да','Да','Да','[{\"id\": \"0\", \"size\": \"35,12\", \"floor\": \"1\", \"price\": 125000, \"building\": \"Блок А\", \"price_code\": \"USD\", \"apartment_layout\": \"1+1\", \"apartment_layout_image\": \"4e86ca4d0ff241f4afe2f5aaa39f419d.jpg\"}]',NULL,NULL,'1207 Antalya, benannt nach dem Jahr der Befreiung Antalyas, wird auf einem 30 Hektar großen Grundstück mit 1.163 Wohnungen und 46 Geschäftslokalen errichtet und ist damit das größte Wohnprojekt Antalyas. Während die 24.712 m² große Grünfläche ein Leben inmitten der herrlichen Natur ermöglicht, bietet sie gleichzeitig die Möglichkeit, das Vergnügen der Stadt und die Ruhe der Natur zu erleben und die sozialen Annehmlichkeiten im Inneren zu nutzen.','Das Projekt 1207 Antalya befindet sich im Stadtteil Kepez, im Herzen der Stadt, nur 9 km vom internationalen Flughafen Antalya, 5 km vom Stadtzentrum und 8 km vom Strand entfernt, mit ausgezeichneten sozialen Einrichtungen für alle und mit einfachem Zugang zu allen Orten.',NULL,0);
